import React, { useContext } from 'react';
import styles from '../../styles/components/admin_navbar.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import NewProject from '../modals/NewProjects';

import { AuthActions } from '../../context/contexts/auth.context';

import useToggle from '../../hooks/useToggle';

import NavbarBtn from '../layout/NavbarBtn';

const AdminNavbar = () => {
	const { logout } = useContext(AuthActions);
	const [ newProject, toggleNewProject ] = useToggle(false);

	return (
		<nav className={styles.navbar}>
			<div className={styles.navbar__controls}>
				<NavbarBtn>
					<FontAwesomeIcon icon="home" />
				</NavbarBtn>
				<NavbarBtn onClick={toggleNewProject}>
					<FontAwesomeIcon icon="newspaper" />
				</NavbarBtn>
				<NavbarBtn>
					<FontAwesomeIcon icon="cog" />
				</NavbarBtn>
				<NavbarBtn>
					<FontAwesomeIcon icon="sign-out-alt" />
				</NavbarBtn>
				<NewProject show={newProject} toggle={toggleNewProject} />
			</div>
			<div className={styles.navbar__pages}>
				<h5 className={styles.dashboard__pages__header}>Pages</h5>
				<ul className={styles.dashboard__pages__list}>
					<li>
						<FontAwesomeIcon className={styles.dashboard__pages__icon} icon="home" />
						<span className={styles.dashboard__pages__text}>Home</span>
					</li>
					<li>
						<FontAwesomeIcon className={styles.dashboard__pages__icon} icon="at" />
						<span className={styles.dashboard__pages__text}>Contact</span>
					</li>
					<li>
						<FontAwesomeIcon className={styles.dashboard__pages__icon} icon="smile" />
						<span className={styles.dashboard__pages__text}>About</span>
					</li>
				</ul>
				<button className={styles.dashboard__pages__btn}>New Project</button>
			</div>
		</nav>
	);
};

export default AdminNavbar;
